import React, { useMemo } from 'react';
import { DEALERS_COLUMN, STATES } from '../../assets/Json/data';
import { TableC } from '../../components/TableC/TableC';
import { DEALERS } from '../../assets/Json/data';
// import TableBordered from '../../containers/TableBordered/TableBordered';

const Dealers = () => {
  const columns = useMemo(() => DEALERS_COLUMN, []);
  const data = useMemo(() => DEALERS, []);
  return (
    <>
      <TableC
        columns={columns}
        searchTitle='Dealer'
        searchPlaceHolder='Search Dealer'
        dropdownList={STATES}
        data={data}
        heading="Dealer's List"
      />
      {/* <TableBordered
        Heading="Dealer's List"
        Title={DealersTitle}
        Users={dealers}
      /> */}
    </>
  );
};

export default Dealers;
